export const token = 'eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOm51bGwsImlzcyI6IlZwaHBaakx1UVl1ZUR1VkViT2Z4VnciLCJleHAiOjE2Mzk2ODQ5OTAsImlhdCI6MTYzOTY3OTU5Mn0.GPdNVXRUSo0ZpXHNRvFMq2FYbCqc_qJLxDnyoCRgT20';
async function getData(url = 'https://api.zoom.us/v2/users/me/meetings', data = {}) {
    const res = await fetch(url, {
        method: 'GET',
        mode: 'cors',
        cache: 'no-cache',
        credentials: 'same-origin',
        headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json'
        },
        redirect: 'follow',
        referrerPolicy: 'no-referrer',
        body: JSON.stringify(data)
    });
    return res.json();
}
